	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; border: 1px solid rgb(0, 0, 0); width: 520px; height: 300px; background-color: rgb(19, 79, 92);\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 512px; height: 292px;\"><p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Sjå videoen til høgre og diskuter følgjande spørsmål med ein medelev:&nbsp;</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<ul style=\"padding-left: 17px; padding-inline-start: 17px;\">\n	<li style=\"font-size:12pt; text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Kva veit du om om kjeldesortering av plast?</span></li>\n	<li style=\"font-size:12pt; text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Kan du bli betre på kjeldesortering av plast?</span></li>\n</ul>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align: left;\"><span><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">Per i dag blir berre 35% av norsk hushaldningsplast kjeldesortert.&nbsp;</span><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">For å løyse problema knytta til produksjon og forbruk av plast, må vi både redusere bruken&nbsp;av plast&nbsp;og i større grad gjenvinne&nbsp;plastavfallet.</span></span></p>\n\n<p style=\"text-align: left;\"><span style=\"color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size:12pt;\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"color: rgb(255, 255, 255); font-family: Arial, sans-serif; font-size:12pt;\">Sett opp ei liste med 3 spørsmål om kjeldesortering av plast , som du lurer på. Bruk deretter <a id=\"triv713\" href=\"javascript:hyperlink713()\" style=\"cursor: pointer;\"><u><span style=\"text-decoration: underline; color:#0000FF;\">denne nettsida</span></u></a> til å finne svar på spørsmåla.</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align:left\"></p></div></div>",
